function App() {
    return (
      <Router>
        <Routes>
          <Route path="/" element={<Homepage />} />
          <Route index element={<Homepage />} />
          <Route path="/about" element={<About />} />
        </Routes>
      </Router>
    );
}

export default aboutpage;
